desktopweb.customCSS:
#calValidStartDate{
  border-radius: 3px;
  margin-top:10px;
  color:#b2bdcb!important;
  margin-left:4px;
}

#calValidEndDate{
  border-radius: 3px;
  margin-top:10px;
  color:#b2bdcb!important;
  margin-left:4px;
}

#calValidStartDate_img{
  margin-top: 10px;
  margin-right: 5px!important;
}

#calValidEndDate_img{
  margin-top: 10px;
  margin-right: 5px!important;
}
div[kwidgettype="Label"], div[kwidgettype="RichText"]{
  outline:none!important;
}

input[type="text"]{
  transition: border-color 0.15s ease-in-out 0s, box-shadow 0.15s ease-in-out 0s;
}

input, select, textarea{
  outline:none!important;
}

::-webkit-input-placeholder {color:#b2bdcb;}
::-moz-placeholder {color:#b2bdcb;}
:-ms-input-placeholder {color:#b2bdcb;}
input:-moz-placeholder {color:#b2bdcb;}

input[type="text"]:focus, input[type="password"]:focus, input[type="email"]:focus, input[type="tel"]:focus, input[type="number"]:focus{
  border-color: #1293CC!important;
}

textarea:focus{
  border-color: #1293CC!important;
}

input[kwidgettype="Button"]{
  outline:none!important;
  cursor:pointer!important;
}

#flxPermissions_flxPermissions:hover, #flxUsers_flxUsers:hover, #flxRoles_flxRoles:hover{
  cursor:pointer!important;
}
#frmUsers_flxViewEditButton:hover{
  cursor:pointer!important;
}
/* #frmPermissions_mainHeader_lblDownloadList:hover, #flxOptionAdded_imgClose:hover, #flxOptionAdded_imgClose #flxRoles_flxRoles:hover{

} */
.address_class{
  white-space: normal!important;
